    S = []
    all_visited = set()
    while len(allNodes) > 0:

        def removalAN(s):
            allNodes.remove(s)
            S.append(s)

        for i in allNodes:
            n = i
            break
        dfs(graph, n, all_visited, lambda node: removalAN(node))

    #scc = []
