    all_visited = set()
    all_count = []
    while len(S) > 0:
        #while S[-1] not in SS:
        #    S.pop()

        n = S[-1]

        def removal(s):
            S.remove(s)

        v, count = dfs(graph, n, all_visited, lambda s: removal(s))
        all_count.append((n, count))

